INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (12, 1, 1, NULL, 'Every Day', '2018-02-27', NULL, 0, '30233859', 'Dedicating this track to all the lonely robots in space.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (13, 1, 3, NULL, 'MONOLOG', '2018-05-13', NULL, 0, '2581651186', 'Stereophonic pictures recorded by a brain. A deep dive into the abyss of instincts. A honest and unfiltered output of the feelings from an alien that has lost his star map. Trying to dismantle the potential answers to unanswered questions. Faith. Loss. Nostalgia. Change. Life. Death. For you and them. All of us.' || CHAR(10, 10) || 'Limited physical edition is [there](./physical/id:1).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (14, 1, 1, NULL, 'Searching', '2018-08-13', NULL, 0, '1571954667', 'When you stop satisfying expectations and embrace the beginning of the end.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (15, 1, 2, 1, 'THE GREAT FILTER', '2018-08-31', NULL, 0, '3617310353', 'When humans get blinded by reality, we must tell them the truth.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (16, 1, 3, NULL, '2358', '2019-03-13', NULL, 0, '1596302206', 'You wander and stumble. Through space and time. Literally. Soul searching and yearning for the one thing nobody has ever seen, but most have felt... Suddenly, something flickers from the glare of your slowly dying flashlight. "That''s not what I''m looking for!", you think. Nonetheless, your ingrained curiosity is stronger... It''s an ancient recording device with some magnetic cassette tapes lying right beside it.; dust-layered, it kind of looks like it was left here on purpose... One tape is still loaded in the recorder deck. "Whatever! It''s 2 minutes to midnight anyway.", you think - and hit the play button.' || CHAR(10, 10) || 'Limited physical edition is [there](./physical/id:2).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (17, 1, 1, 1, 'Frozen Memories', '2019-03-29', NULL, 0, '286448283', 'Do you remember, when everything was moving?' || CHAR(10, 10) || 'Made for [Bento Box Vol. 2](./mention/id:7).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (18, 1, 3, NULL, 'BRAIN I/O', '2019-06-09', '2020-07-13', 0, '2810895713', 'Very personal and raw mind exploration.' || CHAR(10, 10) || 'New output will be added over time to this album...' || CHAR(10) || '#1: 2019-06-09' || CHAR(10) || '#2: 2019-06-13' || CHAR(10) || '#3: 2019-07-02' || CHAR(10) || '#4: 2019-07-12' || CHAR(10) || '#5: 2019-07-20' || CHAR(10) || '#6: 2019-08-15' || CHAR(10) || '#7: 2019-12-12' || CHAR(10) || '#8: 2019-12-28' || CHAR(10) || '#9: 2020-04-23' || CHAR(10) || '#10: 2020-07-13');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (19, 1, 1, 2, 'They Shot My Friend', '2019-07-07', NULL, 0, '3891255445', 'Dedicated to Sina. Rest in peace my friend. I will neither forget nor forgive what they did to you.' || CHAR(10, 10) || 'Made for [The Fencepost Reclamation Project Volume 5](./mention/id:8).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (20, 1, 1, 2, 'The Sad Lightness Of Being', '2019-07-07', NULL, 0, '2901018221', 'A story about being strong, but still vulnerable.' || CHAR(10, 10) || 'Made for [The Fencepost Reclamation Project Volume 5](./mention/id:8).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (21, 1, 2, NULL, 'KEEN', '2019-12-13', NULL, 0, '2895888302', 'History is over and the future is just an idea.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (22, 2, 1, NULL, 'Rainbows & Unicorns', '2019-12-23', NULL, 1, '2223839995', 'For your mellow (xmas) days.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (23, 1, 3, NULL, 'LET IT ALL GO, Volume 1', '2020-02-13', NULL, 0, '3162557576', 'Sit back and relax. Breathe slowly. Try to focus on one thought at a time. Let your emotions flow, but do not let them overwhelm you. Deconstruct your thoughts. Study each little part. Understand, or accept your confusion for now. You do not have energy. You are energy. Everything is here. In your mind. Peace, you can find. Repeat.' || CHAR(10, 10) || 'Purchases on Bandcamp include 24bit/48kHz versions of both the Original and Waveless Mix.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (24, 1, 3, NULL, '1996', '2020-06-26', NULL, 0, '3288578507', 'When the past never ends.' || CHAR(10) || 'The future never begins.' || CHAR(10) || 'One can only be.' || CHAR(10) || 'Forever young.' || CHAR(10, 10) || 'When you listen to this album, remember that times and situations change, but your heart doesn''t have to necessarily.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (25, 1, 3, NULL, 'LET IT ALL GO, Volume 2', '2020-09-03', NULL, 0, '587722148', 'Sit back and relax. Breathe slowly. Try to focus on one thought at a time. Let your emotions flow, but do not let them overwhelm you. Deconstruct your thoughts. Study each little part. Understand, or accept your confusion for now. You do not have energy. You are energy. Everything is here. In your mind. Peace, you can find. Repeat.' || CHAR(10, 10) || 'Track 2 (Binaural Headphone Mix) should be listened on good stereo headphones or it may sound strange. It has binaural beats operating at a frequency of ~1-2Hz (delta pattern).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (26, 1, 3, NULL, 'CHILL TRACKS 2016-2020', '2020-12-13', NULL, 0, '131808411', 'A selection of chill tracks from my back catalog 2016-2020. I hope you find some relaxation at the end of this unusual year.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (27, 1, 3, NULL, 'FLOATING HIGH', '2021-01-01', NULL, 0, '1204865255', 'A magic wooden bench.' || CHAR(10) || 'Trees.' || CHAR(10) || 'Wild animals.' || CHAR(10) || 'You.' || CHAR(10) || 'And the cloudy sky.' || CHAR(10, 10) || 'Digital and physical album purchases on Bandcamp include the bonus track "A Night With My Imaginary Friend".' || CHAR(10, 10) || 'Limited physical editions are available as [there](./physical/id:5) and [there](./physical/id:6).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (28, 1, 1, NULL, 'Uncertain', '2021-05-07', NULL, 0, '2666379051', 'A song about our future.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (29, 1, 2, NULL, 'THE BAND WITH THE DRUMMER WHO KNEW ONLY ONE RHYTHM', '2021-06-07', NULL, 0, '2317686308', 'A small band plays in a smoky open air club. Their instruments are slightly out of tune. But the crowd doesn''t care. Out of tune experiences is what they got used to.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (30, 1, 1, NULL, 'Flux', '2021-08-13', NULL, 0, '2224755430', 'Everything. Nothing. Doesn''t matter. You just float. Somewhere. Sometime.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (31, 5, 4, NULL, 'Haphe (SPARTALIEN''s Wicca Remix)', '2021-08-31', NULL, 1, '563831413', 'A spooky remix of the track [Haphe](//ediblewaves.bandcamp.com/track/haphe) made upon request for [ediblewaves](//ediblewaves.bandcamp.com).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (32, 1, 3, NULL, 'UNTOLD STORIES', '2021-09-22', NULL, 0, '1766454808', 'Do you know that feeling, when you hear a sound, and you suddenly feel like you''re in another place? When a sound triggers a feeling, or a memory? And then, when the sound is gone, and the world turns silent, you miss the sound?' || CHAR(10, 10) || 'This body of work is quiet, but also loud, and very emotional. Raw, but not rushed, feelings. Intentionally improvised moments to get lost in.' || CHAR(10, 10) || 'There is also a "[Doomer''s Delight](./music/id:33)" special edition.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (33, 1, 3, NULL, 'UNTOLD STORIES (Doomer''s Delight)', '2021-09-22', NULL, 0, '762897740', 'Do you know that feeling, when you hear a sound, and you suddenly feel like you''re in another place? When a sound triggers a feeling, or a memory? And then, when the sound is gone, and the world turns silent, you miss the sound?' || CHAR(10, 10) || 'This body of work is quiet, but also loud, and very emotional. Raw, but not rushed, feelings. Intentionally improvised moments to get lost in.' || CHAR(10, 10) || 'This is a special edition of [UNTOLD STORIES](./music/id:32).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (34, 1, 3, NULL, 'OKAY, BUT CAN YOU RAP TO THIS?', '2022-11-23', NULL, 0, '4047724916', 'Some fun tracks to get back into it. Thank you for still being here.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (35, 1, 3, NULL, 'WARM SUMMER EVENING', '2023-04-21', NULL, 0, '73692186', 'It is a warm summer evening.' || CHAR(10) || 'A light breeze blows gently over the brushwood-covered fields.' || CHAR(10) || 'Clouds drift across the dusky sky and thicken into a black carpet as night approaches.' || CHAR(10, 10) || 'With darkness comes clarity.' || CHAR(10) || 'For a short while, all thoughts, like a waterfall, flow inexorably downwards.' || CHAR(10) || 'Silent images flicker before the closed eyes.' || CHAR(10) || 'Suddenly, the memory.' || CHAR(10) || 'Their departure.' || CHAR(10) || 'His task.' || CHAR(10, 10) || 'The emptiness that fills everything when a heart breaks.' || CHAR(10) || 'The realisation that nothing can be changed.' || CHAR(10) || 'The hope of being allowed to return home soon.' || CHAR(10, 10) || 'Knees on the floor.' || CHAR(10) || 'Breathing calmly.' || CHAR(10) || 'The silent call, loud.' || CHAR(10, 10) || 'Twelve figures manifest in a circle.' || CHAR(10) || 'The thirteen are complete again.' || CHAR(10, 10) || 'An approving nod.' || CHAR(10) || 'A final embrace.' || CHAR(10) || 'A collective departure.' || CHAR(10) || 'Each in a different direction.' || CHAR(10, 10) || 'It is a cold winter evening.' || CHAR(10) || 'A biting wind blows mercilessly across the snow-covered fields.' || CHAR(10) || 'The sky is cloudless and the moon is full.' || CHAR(10, 10, 10) || 'Digital album purchases on Bandcamp include the bonus track "I Have Seen The Shadow Again".');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (36, 1, 3, NULL, 'THE DYING SPACESHIP SYMPHONY', '2023-06-17', NULL, 1, '2972069926', 'The atmosphere of a moment that never seemed to end.' || CHAR(10, 10, 10) || 'Bandcamp exclusive.');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (37, 1, 1, 3, 'Yellow Soul Grinder', '2023-07-13', NULL, 0, '1255097516', 'It was already too late before it started to consume you.' || CHAR(10, 10, 10) || 'Made for [SFTS: The Backrooms Comp : Level 2](./mention/id:14).');
INSERT INTO rls (id, artist_id, rls_type_id, label_id, name, pub_date, upd_date, is_freedl, bandcamp_id, description) VALUES (38, 7, 3, NULL, 'Sound.Ex 1', '2004-10-05', NULL, 1, '2619863095', 'A selection of first steps in creating my own sound (as "[arT2](./catalog/artist:7)" back then). 2001-2006. Experimental trips, dark passages, and a lot of mood-explanation. Whatever.. enjoy.');
