INSERT INTO phy (id, name, description) VALUES (1, 'Artefact S9M1', 'Type: USB Flash Drive + Digital Album' || CHAR(10) || 'Released: 2018-06-10' || CHAR(10, 10) || 'In May 2018, aerchologists have discovered five objects from an undisclosed location.' || CHAR(10) || 'All of the objects are made of an unknown black material and have the shape of a triangle. The border is painted white.' || CHAR(10) || 'On top, on the lower end of the triangles, a pattern of dots is visible. Every triangle has its own pattern. Theories evolved quickly around the dots and the most common one is, that these could be some sort of counter.' || CHAR(10) || 'Above the dot patterns, a small electronic device with an aluminum case is plugged into a rectangular slot.' || CHAR(10) || 'Above this slot, a twisted line points to the upper corner of the triangle. The aerchologists where startled when they found out that these strangely glow in the dark.' || CHAR(10, 10) || 'A few days after the initial discovery, scientists found out that the aluminum devices in the slot are storage devices. Here is what they could decode:' || CHAR(10) || '- MONOLOG album in three different file formats: WAV, FLAC, MP3' || CHAR(10) || '- MONOLOG album to stream and download on Bandcamp.' || CHAR(10) || '- PDF file with the album information and lyrics.' || CHAR(10) || '- High resoultion album cover.' || CHAR(10) || '- Bonus album track- and promo art.' || CHAR(10) || '- Art, documents, photos and videos to watch/read while/after listening to the album.' || CHAR(10, 10) || 'Digital release is [there](./music/id:13).');
INSERT INTO phy (id, name, description) VALUES (2, 'Memoria S9M2, 2358 Limited Edition', 'Type: Audio-CD + Digital Album' || CHAR(10) || 'Released: 2019-08-13' || CHAR(10, 10) || '"They all feel the same."' || CHAR(10, 10) || 'This is the limited CD edition of the 2358 album. Limited edition of 7.' || CHAR(10, 10) || 'Contains:' || CHAR(10) || '- 2358 album Audio-CD.' || CHAR(10) || '- 2358 album to stream and download on Bandcamp.' || CHAR(10) || '- Original character drawing (Pencil, 12x12cm).' || CHAR(10) || '- CD Jewel Case with handwritten front and back Inlay.' || CHAR(10) || '- A real four-leaved clover.' || CHAR(10) || '- Love.' || CHAR(10, 10) || 'Digital release is [there](./music/id:16).');
INSERT INTO phy (id, name, description) VALUES (3, 'Logo T-Shirt, S9M3', 'Type: T-Shirt' || CHAR(10) || 'Released: 2020-07-06' || CHAR(10, 10) || 'Official logo on a comfortable unisex T-Shirt.' || CHAR(10, 10) || 'Material: 100% Cotton, Oeko-Tex Standard 100' || CHAR(10) || 'Colors: black on white, white on black' || CHAR(10) || 'Sizes: small, medium, large' || CHAR(10) || 'Weight: 145 g/m²' || CHAR(10) || 'Washing: max. 40°C, inside-out, similiar colors, don''t iron over the print');
INSERT INTO phy (id, name, description) VALUES (4, 'Logo Sticker, S9M4', 'Type: Sticker' || CHAR(10) || 'Released: 2020-07-22' || CHAR(10, 10) || 'Official logo on a Sticker.' || CHAR(10, 10) || 'Colors: black on white, white on black' || CHAR(10) || 'Sizes: 58x70mm, 62x82mm, 80x100mm');
INSERT INTO phy (id, name, description) VALUES (5, 'Memory S9M5, FLOATING HIGH Limited Edition CD-R', 'Type: Audio CD + Digital Album' || CHAR(10) || 'Released: 2021-01-01' || CHAR(10, 10) || 'This is the limited CD edition of the FLOATING HIGH album. Limited edition of 5.' || CHAR(10, 10) || 'Contains:' || CHAR(10) || '- FLOATING HIGH album Audio-CD.' || CHAR(10) || '- FLOATING HIGH album to stream and download on Bandcamp.' || CHAR(10) || '- Includes bonus track: A Night With My Imaginary Friend.' || CHAR(10) || '- CD jewel case, cover and disc printed, handwritten tracklist.' || CHAR(10, 10) || 'Digital release is [there](./music/id:27).');
INSERT INTO phy (id, name, description) VALUES (6, 'Memory S9M6, FLOATING HIGH Limited Edition USB-Stick', 'Type: USB Flash Drive + Digital Album' || CHAR(10) || 'Released: 2021-01-01' || CHAR(10, 10) || 'This is the limited USB-Stick edition of the FLOATING HIGH album. Limited edition of 7.' || CHAR(10, 10) || 'Contains:' || CHAR(10) || '- FLOATING HIGH album in three different file formats: WAV, FLAC, MP3' || CHAR(10) || '- FLOATING HIGH album to stream and download on Bandcamp.' || CHAR(10) || '- Includes bonus track: A Night With My Imaginary Friend.' || CHAR(10) || '- Metal cast USB-Stick (16GB, USB 3.1, FAT32, Win/Mac/Linux).' || CHAR(10) || '- Unique piece of wood to use as a stand for the USB-Stick. All were cut from the same tree branch.' || CHAR(10) || '- Cover art in different sizes including high resolution.' || CHAR(10) || '- Photos to watch while listening to the album.' || CHAR(10, 10) || '**Warning for allergy sufferers**: Wood was treated with a bit of coconut fat.' || CHAR(10, 10) || 'Digital release is [there](./music/id:27).');
