INSERT INTO mention (id, subject, year, description) VALUES (2, 'Live on MighTV 2020-11-29', '2020', 'The [Might](//might.digital) crew invited me to create some music on their livestream.');
INSERT INTO mention (id, subject, year, description) VALUES (3, 'Shikantaza Creativity Interview', '2021', '[Shikantaza Art](//shikantaza.cyberpunkonline.net) asked me to answer some questions.');
INSERT INTO mention (id, subject, year, description) VALUES (4, 'ediblewaves'' YouTube Channel', '2021', 'ediblewaves *aka* Klangachse invited me to hang out on his livestream.' || CHAR(10) || 'Also check out his [Bandcamp page](//ediblewaves.bandcamp.com) and [YouTube channel](//www.youtube.com/@ediblewaves8027).' || CHAR(10, 10) || 'Starts at: 0:24:04');
INSERT INTO mention (id, subject, year, description) VALUES (5, 'Spooky Kitten Records'' WHiTMiRE Reviews Music: Episode 26', '2022', '[Michael Whitmire](//www.youtube.com/@SpookyKittenRecords) played [Flux (feat. Stevie Lee Price)](./catalog/track:97) on his music review show.' || CHAR(10, 10) || 'Starts at: 1:46:27');
INSERT INTO mention (id, subject, year, description) VALUES (6, 'Resonate on CAMP Radio 2022-03-27', '2022', '[The Argent Grub](//theargentgrub.co.uk) included [Rainbows & Unicorns](./catalog/track:58) in the Resonate playlist.');
INSERT INTO mention (id, subject, year, description) VALUES (7, 'Bento Box, Vol. 2', '2019', 'A second delicious dose of Kaiseki Digital for your enjoyment.' || CHAR(10, 10) || 'Released 2019-03-29 on [Kaiseki Digital](//kaisekidigital.bandcamp.com).' || CHAR(10, 10) || 'I contributed track 1.');
INSERT INTO mention (id, subject, year, description) VALUES (8, 'the fencepost reclamation project volume 5', '2019', 'This is the fifth volume of an open-ended remix project of Fencepost material originally released by Evelyn Records in 2002.' || CHAR(10, 10) || 'Released 2018-10-24 on [<1](//lessthanone.bandcamp.com).' || CHAR(10, 10) || 'I contributed track 116 + 117.');
INSERT INTO mention (id, subject, year, description) VALUES (9, 'SFTS: The Backrooms Comp', '2022', '"If you''re not careful and you noclip out of reality in the wrong areas, you''ll end up in the Backrooms, where it''s nothing but the stink of old moist carpet, the madness of mono-yellow, the endless background noise of fluorescent lights at maximum hum-buzz, and approximately six hundred million square miles of randomly segmented empty rooms to be trapped in. God save you if you hear something wandering around nearby, because it sure as hell has heard you."' || CHAR(10, 10) || 'Based on a concept created by 4chan, 35 artists took part in this compilation to make the listener feel as if they are experiencing the never-ending dimensions of the backrooms.' || CHAR(10, 10) || 'Released 2022-08-19 on [Sounds for the Soul Records](//soundsforthesoul.bandcamp.com).' || CHAR(10, 10) || 'I contributed track 5.');
INSERT INTO mention (id, subject, year, description) VALUES (10, 'Martina''s "The Only Way Is Up" Spotify Playlist', '2022', 'Martina creates weekly playlists. You can find more playlists on her [Spotify profile](//open.spotify.com/user/m0o63p2xyamfpkw2xg4mw26nc).' || CHAR(10, 10) || 'I contributed track 2.');
INSERT INTO mention (id, subject, year, description) VALUES (11, 'Martina''s "Add Some Music To Your Day" Spotify Playlist', '2022', 'Martina creates weekly playlists. You can find more playlists on her [Spotify profile](//open.spotify.com/user/m0o63p2xyamfpkw2xg4mw26nc).' || CHAR(10, 10) || 'I contributed track 1.');
INSERT INTO mention (id, subject, year, description) VALUES (12, 'SFTS: Experimental Ambient Compilation', '2022', 'Another fine compilation from Sounds for the Soul Records. This time exploring experimental ambient.' || CHAR(10, 10) || 'Released 2022-11-18 on [Sounds for the Soul Records](//soundsforthesoul.bandcamp.com).' || CHAR(10, 10) || 'I contributed track 7.');
INSERT INTO mention (id, subject, year, description) VALUES (13, 'Resonate on CAMP Radio 2022-12-04', '2022', '[The Argent Grub](//theargentgrub.co.uk) included [Flux (feat. Stevie Lee Price)](./catalog/track:97) in the Resonate playlist.');
INSERT INTO mention (id, subject, year, description) VALUES (14, 'SFTS: The Backrooms Comp : Level 2', '2022', '"Enter into another level of the endless labyrinth."' || CHAR(10, 10) || 'Released 2023-07-15 on [Sounds for the Soul Records](//soundsforthesoul.bandcamp.com).' || CHAR(10, 10) || 'I contributed track 36.');
INSERT INTO mention (id, subject, year, description) VALUES (15, 'Spooky Kitten Records'' WHiTMiRE Reviews Music: Episode 76', '2023', '[Michael Whitmire](//www.youtube.com/@SpookyKittenRecords) played [Biting Wind](./catalog/track:154) on his music review show.' || CHAR(10, 10) || 'Starts at: 0:28:26');
